function create_pdf() {
    window.jsPDF = window.jspdf.jsPDF;
    var doc = new jsPDF();
    var image_data = "data:image/png;base64,"
    doc.addImage(image_data, 'PNG', 0, 0, 210, 297);

    //add set font properties
    doc.setFontSize(12);
    doc.setTextColor(40);

        recipe = getRecipe();

    //set date
    var today = new Date();
    var dd = String(today.getDate()).padStart(2, '0');
    var mm = String(today.getMonth() + 1).padStart(2, '0'); //January is 0!
    var yyyy = today.getFullYear();

    //get time
    var time = today.getHours() + ":" + today.getMinutes() + " Uhr";

    today = dd + '.' + mm + '.' + yyyy;
    doc.text(180, 37, today);
    doc.text(85, 215, today)
    doc.text(122, 60, time)

    //start time
    const upTime = new Date(parseFloat(getServerUpTime())*1000)
    doc.text(55, 60,  upTime.toLocaleString() + " Uhr")

    //recipe information
    doc.text(55, 66, recipe.name);
    total_brew_water = 0;
    for (let index = 0; index < recipe.brauwasser.length; index++) {
        total_brew_water += parseInt(recipe.brauwasser[index][1])
    }
    doc.text(70, 89, String(total_brew_water))
    doc.text(70, 95, "123")         //SAMPLE DATA
    doc.text(70, 101.4, "123")

    //sum hop
    sum = 0;
    for (let index = 1; index <= recipe.wuerzekochen.length-1; index++) {
        console.log(index)
        sum += parseInt(recipe.wuerzekochen[index][1])      //right index ???
    }
    doc.text(70, 107, String(sum))
    today = dd + '_' + mm + '_' + yyyy;
    doc.save(today+"_Brauprotokoll.pdf");
}